import players from './JsonData/players.json'
import playerRank from './PlayerRank.json'

var playerNames = new Array(players.length);
for (var i = 0; i < players.length; i++) {
    playerNames[i] = players[i].first_name + " " + players[i].last_name;
}
var allPlayers = [];
const axios = require('axios').default;
var tooManyRequests = false;
for (var j = 0; j <= playerRank.length; j++) {
    var fullName = playerRank[j.toString()];
    axios.get('https://www.balldontlie.io/api/v1/players?search=' + fullName)
        .then(function (response) {
            var pageOfPlayers = response.data;
            for (var k = 0; k < pageOfPlayers.data.length; k++) {
                if (playerNames.includes(pageOfPlayers.data[k].first_name + " " + pageOfPlayers.data[k].last_name)) {
                    console.log(pageOfPlayers.data[k].first_name);
                    console.log(pageOfPlayers.data[k].last_name);
                    allPlayers.push(pageOfPlayers.data[k]);
                }
            }
        })
        .catch(function (error) {
        })
        .then(function () {
        });
}
console.log(99);
console.log(allPlayers);
